description:
This hardcover contains over 2700 beautiful, historic and/or instructional combinations in Informant format. The diagrams are clear, the binding excellent, the format easy to use. The combinations are plentiful and challenging enough for this book to be useful to a club or professional player for his or her lifetime. If you have this book, you will not need another book on combinations. 
